import React from 'react';

function SidebarButton({ isActive, onClick, tabId, children }) {
  return (
    <button
      onClick={() => onClick(tabId)}
      className={`sidebar-button ${isActive ? 'sidebar-button-active' : 'sidebar-button-inactive'}`}
    >
      {children}
    </button>
  );
}

function TFSAContent() {
  return (
    <></>
  );
}

function RESPContent() {
  return (
    <></>
  );
}

function StockContent({ stockId }) {
  const stockData = {
    tesla: { name: 'Tesla', symbol: 'TSLA', price: 242.50, change: 2.5 },
    blackrock: { name: 'BlackRock', symbol: 'BLK', price: 785.20, change: -0.8 },
    pepsico: { name: 'PepsiCo', symbol: 'PEP', price: 172.30, change: 1.2 }
  };

  const stock = stockData[stockId];

  return (
    <div className="stock-container">
      <h1 className="stock-title">Stock Details</h1>
      <div className="stock-card">
        <div className="stock-header">
          <img 
            src="/api/placeholder/48/48" 
            alt={stock.name} 
            className="stock-logo"
          />
          <div>
            <h2 className="stock-name">{stock.name}</h2>
            <span className="stock-symbol">{stock.symbol}</span>
          </div>
        </div>
        
        
      </div>
    </div>
  );
}

function Dashboard() {
  const [activeTab, setActiveTab] = React.useState('tfsa');

  function getMainContent() {
    if (activeTab === 'tfsa') return <TFSAContent />;
    if (activeTab === 'resp') return <RESPContent />;
    return <StockContent stockId={activeTab} />;
  }

  return (
    <div className="dashboard">
      <div className="dashboard-sidebar">
        <div className="sidebar-header">
          <h2 className="sidebar-title">Finance Dashboard</h2>
        </div>

        <div className="sidebar-section">
          <h3 className="sidebar-section-title">Accounts</h3>
          <nav className="sidebar-nav">
            <SidebarButton 
              onClick={setActiveTab} 
              tabId="tfsa" 
              isActive={activeTab === 'tfsa'}
            >
              TFSA
            </SidebarButton>
            <SidebarButton 
              onClick={setActiveTab} 
              tabId="resp" 
              isActive={activeTab === 'resp'}
            >
              RESP
            </SidebarButton>
          </nav>
        </div>

        <div className="sidebar-section">
          <h3 className="sidebar-section-title">Stocks</h3>
          <nav className="sidebar-nav">
            <SidebarButton 
              onClick={setActiveTab} 
              tabId="tesla" 
              isActive={activeTab === 'tesla'}
            >
              Tesla
            </SidebarButton>
            <SidebarButton 
              onClick={setActiveTab} 
              tabId="blackrock" 
              isActive={activeTab === 'blackrock'}
            >
              BlackRock
            </SidebarButton>
            <SidebarButton 
              onClick={setActiveTab} 
              tabId="pepsico" 
              isActive={activeTab === 'pepsico'}
            >
              PepsiCo
            </SidebarButton>
          </nav>
        </div>
      </div>

      <div className="dashboard-content">
        {getMainContent()}
      </div>
    </div>
  );
}

export default Dashboard;
